import React from 'react';
import { AppBar, Toolbar, Box, Autocomplete, TextField } from '@mui/material';
import MovieIcon from '@mui/icons-material/Movie';

const dummyArray = ["eMemory", "Brahmastra", "Forest Grump"]
const Header = () => {
    return (
        <div>
            <AppBar>
                <Toolbar>
                    <Box width={'20%'}>
                        <MovieIcon />
                    </Box>
                    <Box width={'50%'} margin={'auto'}>
                        <Autocomplete
                            freeSolo
                            options={dummyArray.map((option) => option)}
                            renderInput={(params) => <TextField variant="outlined" {...params} label="Search Across Multiple Movies" />}
                        /> 
                    </Box>
                </Toolbar>
            </AppBar>;
        </div>
    );
}

export default Header;
